import Oval from './Oval'
import React, { useState, useEffect } from 'react';

export default function TechSkills() {
    const [isDesktop, setDesktop] = useState(window.innerWidth > 1050);
    const updateMedia = () => {
        setDesktop(window.innerWidth > 1050);
      };

      useEffect(() => {
        window.addEventListener("resize", updateMedia);
        return () => window.removeEventListener("resize", updateMedia);
    });
    let component = "";
    if (isDesktop) {
        component = (<div className="tech-skills-container">
        <div className="row1">
          <Oval styleType="ux" textName="ux research" />
          <Oval styleType="ux" textName="user testing" />
          <Oval styleType="ux" textName="ux strategy" />
          <Oval styleType="dev" textName="javascript" />
          <Oval styleType="dev" textName="react.js" />

        </div>
        <div className="row2">
          <Oval styleType="ux" textName="prototyping" />
          <Oval styleType="ux" header={true} textName="ux design" />
          <Oval styleType="dev" textName="python" />
          <Oval styleType="dev" header={true} textName="front end dev" />
          <Oval styleType="dev" textName="bootstrap" />
        </div>
        <div className="row3">
          <Oval styleType="ux" textName="wireframing" />
          <Oval styleType="ux" textName="adobe xd" />
          <Oval styleType="dev" textName="html" />
          <Oval styleType="dev" textName="css" />
          <Oval styleType="dev" textName="github" />
        </div>
        <div className="row4">
          <Oval styleType="fine-art" textName="drawing" />
          <Oval styleType="fine-art" textName="digital painting" />
          <Oval styleType="visual" textName="ui design" />
          <Oval styleType="visual" textName="typography" />
          <Oval styleType="visual" textName="graphic design" />
        </div>
        <div className="row5">
          <Oval styleType="fine-art" textName="painting" />
          <Oval styleType="fine-art" header={true} textName="fine art" />
          <Oval styleType="visual" textName="infographics" />
          <Oval styleType="visual" header={true} textName="visual design" />
          <Oval styleType="visual" textName="adobe photoshop" />
        </div>
        <div className="row6">
          <Oval styleType="fine-art" textName="color theory" />
          <Oval styleType="fine-art" textName="illustration" />
          <Oval styleType="fine-art" textName="composition" />
          <Oval styleType="visual" textName="adobe illustrator" />
          <Oval styleType="visual" textName="adobe indesign" />
        </div>

    </div>);

    } else {
        component = '';
    }


    return (
        {component}
    )
}
